import React from "react";
import { ListGroup, Card, Badge } from "react-bootstrap";
import { If, Then, Else } from "react-if";

function TodoList(props) {
  return (
    <ListGroup>
      {props.list.map((item) => (
        <Card
          bg={"light"}
          key="4"
          text={"light" === "light" ? "dark" : "white"}
          style={{ width: "100%" }}
          className="mb-2"
        >
          <span onClick={() => props.handleComplete(item._id)} onClose={props.handleDelete()}>
            <Card.Header>
              <If condition={item.complete == false}>
                <Then>
                <Badge pill variant="success">
                pending
              </Badge>{" "}
                </Then>
                <Else>
                <Badge pill variant="danger">
                complete
              </Badge>{" "}
                </Else>
              </If>

              {item.assignee}
            </Card.Header>
            <Card.Text>
              {item.text}
              <br />
              Difficulty: {item.difficulty}
            </Card.Text>
          </span>
        </Card>
      ))}
    </ListGroup>
  );
}

export default TodoList;
